import { Input, Form, Button } from "antd";


const PostCardForm = () => {
  return (
    <Form onFinish={onsubmit}>
        <Input.TextArea />
        <Button type="primary" htmlType="submit">
          Submit
        </Button>

    </Form>
  );
};

export default PostCardForm;
